import React from 'react';
import { book } from '../../types';

interface props {
    books: book[];
}
export const Books = ({ books }: props) => {
    return (
        <div className="bg-teal-300">
            <div>
                <p className="py-10 text-3xl">Books</p>
            </div>
            <div>
                {books.map((book) => (
                    <p>{book.name}</p>
                ))}
            </div>
        </div>
    );
};
